- input: "TEXT\x1CC00006486\x1CH4.105988.TEXT\x1CH4.105988\x1CH4\x1CThe Indiana Republican
    Party had a copier lease with IKON but decided we needed new copiers with a different
    company.  So we worked with Sharp who decided that they would buyout the lease
    from IKON and then we would get copiers under a new lease with Sharp.  We started
    the buyout process with IKON & Sharp in May 2009.  Therefore Sharp gave us a check
    to pay for the remaining amount of our lease with IKON based on the lease amount
    in May.  However, IKON didn't get the paperwork done until August and therefore
    billed us June & July for the copier rental.  When it was time for IKON to bill
    us for the buyout in August the amount billed for the buyout was less than the
    check that Sharp gave us. Hence the discrepency in the negative disbursement from
    Sharp and then large amount paid to IKON.  \n"
